import React, { useState, useEffect } from 'react';
import axios from 'axios';
import UserForm from './UserForm';

function FetchingData() {
    const [users, setUsers] = useState([]);
    const [roles, setRoles] = useState([]);
    const [selectedUser, setSelectedUser] = useState(null);
    const [formData, setFormData] = useState({});
    const [isFormVisible, setIsFormVisible] = useState(false);

    // Fetch users and roles data
    useEffect(() => {
        axios.get('http://localhost:8000/user/')
            .then(response => {
                setUsers(response.data);
            })
            .catch(err => console.error('Failed to fetch users:', err));

        axios.get('http://localhost:8000/roles/')
            .then(response => {
                setRoles(response.data);
            })
            .catch(err => console.error('Failed to fetch roles:', err));
    }, []);

    // Handle form input changes
    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();
        const isNewUser = !selectedUser;
        const url = isNewUser ? 'http://localhost:8000/user/' : `http://localhost:8000/user/${selectedUser.id}/`;
        const method = isNewUser ? 'post' : 'put';

        // Create the data object
        const data = {
            ...formData,
            id: isNewUser ? Math.max(0, ...users.map(user => user.id)) + 1 : selectedUser.id,
        };

        axios({
            method,
            url,
            data,
        })
            .then(response => {
                const user = response.data;

                if (isNewUser) {
                    console.log('New user added:', user);
                    setUsers([...users, user]);
                } else {
                    console.log('User updated:', user);
                    setUsers(users.map(u => u.id === selectedUser.id ? user : u));
                }

                // Reset form data and visibility
                setSelectedUser(null);
                setFormData({});
                setIsFormVisible(false);
            })
            .catch(err => console.error(`Failed to ${method === 'post' ? 'add' : 'update'} user:`, err));
    };

    // Handle user deletion
    const deleteUser = (userId) => {
        axios.delete(`http://localhost:8000/user/${userId}/`)
            .then(() => {
                console.log(`User with ID ${userId} deleted.`);
                setUsers(users.filter(user => user.id !== userId));
            })
            .catch(err => console.error(`Failed to delete user with ID ${userId}:`, err));
    };

    // Prepare form data for editing a user
    const handleEditButtonClick = (user) => {
        setSelectedUser(user);
        setFormData({
            name: user.name,
            username: user.username,
            password: user.password,
            email: user.email,
            phone: user.phone,
            address: user.address,
            city: user.city,
            zipcode: user.zipcode,
            company: user.company,
            website: user.website,
            role: user.role,
            created_at: user.created_at,
            updated_at: user.updated_at,
        });
        setIsFormVisible(true);
    };

    // Handle "Add User" button click
    const handleAddUserButtonClick = (user) => {
        setSelectedUser(user);
        setFormData({
            name: user.name,
            username: user.username,
            password: user.password,
            email: user.email,
            phone: user.phone,
            address: user.address,
            city: user.city,
            zipcode: user.zipcode,
            company: user.company,
            website: user.website,
            role: user.role,
            created_at: Date.now().toLocaleString(),
            updated_at: user.updated_at,
        });
        setIsFormVisible(true);
    };

    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
            <h1 style={{ textAlign: 'center' }}>CRUD Data Process</h1>
            <ul>
                {users.map((user) => (
                    <li key={user.id}>
                        {user.id} - {user.username} - {user.name} - {user.password} - {user.email} - {user.phone} - {user.address}, {user.city}, {user.zipcode} - {user.company} - {user.website} - {user.role}
                        - Created At: {user.created_at} - Updated At: {user.updated_at}
                        <button onClick={() => handleEditButtonClick(user)}>Edit</button>
                        <button onClick={() => deleteUser(user.id)}>Delete</button>
                    </li>
                ))}
            </ul>
            <button onClick={handleAddUserButtonClick} style={{ marginBottom: '20px' }}>Add New User</button>

            {isFormVisible && (
                <UserForm
                    formData={formData}
                    handleInputChange={handleInputChange}
                    handleSubmit={handleSubmit}
                    selectedUser={selectedUser}
                    roles={roles}
                />
            )}
        </div>
    );
}

export default FetchingData;
